import React, { Component } from 'react'
import data from "./data.json"

const ProformaItemList = data.proformaItem;

class ProformaItem extends Component {
    render() {
        return(
            <div>
                {
                    data.proformaItem.map((data, i) => {
                        return (
                            <div key={i}>
                                <tr>{data.product_id}</tr>
                            </div>
                        )
                    })
                }
            </div>
        )
    }
}
export default ProformaItem
